import React from "react";
import "./Trash.css";
import Profile from "./Profile";
import Header from "../Workplace/Header";

function Profile_trash() {
    return (
        <div>
            <Header />
            <Profile />
            <div className="collaborators">
                <h2>Recently Deleted</h2>
            </div>
        </div>
    );
}

export default Profile_trash;
